# https://leetcode.com/problems/find-all-anagrams-in-a-string/
# leetcode:438

class Solution:
    def findAnagrams(self, s, p):
        """
        slide window
        计数器记录字符出现次数
        1.left前进
            a.完全匹配anagram后:left+=1,计数器中最早的字符清零
            b.不匹配的字符出现:left=right+1,计数器中所有字符-1
            c.部分匹配时:left不动,计数器中相应字符+1
        2.right前进
            a.完全匹配anagram后,right+=1
            b.不匹配的字符出现,right+=1
            c.部分匹配时,right+=1
            d.部分匹配时,right的字符超过计数器,right不动,left+1
        :param s:
        :param p:
        :return:
        """
        if not s.strip() or not p.strip():
            return []
        ret = []
        char_counter_dict = {}  # 计数器
        char_max_counter_dict = {}  # p中字符出现的次数,计数器的最大值
        for c in p:
            char_counter_dict[c] = 0
            if c in char_max_counter_dict:
                char_max_counter_dict[c] += 1
            else:
                char_max_counter_dict[c] = 1

        left = 0
        right = 0
        while right < len(s):
            if s[right] in char_counter_dict and char_counter_dict[s[right]] < char_max_counter_dict[s[right]]:
                """字符在p中,并且未超过计数器"""
                char_counter_dict[s[right]] += 1
                # 是否anagram
                if self.is_anagram(char_counter_dict, char_max_counter_dict):
                    ret.append(left)
                    # 字符出现次数-1
                    char_counter_dict[s[left]] -= 1
                    left += 1
                right += 1
            elif s[right] in char_counter_dict and char_counter_dict[s[right]] == char_max_counter_dict[s[right]]:
                """字符在p中,并且超过计数器"""
                # 字符出现次数-1
                char_counter_dict[s[left]] -= 1
                left += 1
            else:
                """字符不在p中"""
                left = right + 1
                # 清空计数器
                self.reset_dict(char_counter_dict)
                right += 1

        return ret

    def reset_dict(self, dict):
        for k in dict.keys():
            dict[k] = 0

    def is_anagram(self, dict, max_dict):
        for k in dict.keys():
            if dict[k] < max_dict[k]:
                return False
        return True

    def findAnagrams_2(self, s, p):
        """
        1.先把p排序为p_sorted
        2.slide window长度固定为len(p),将窗口内的字符串排序,然后跟p_sorted比较
        :param s:
        :param p:
        :return:
        """
        if not s.strip() or not p.strip():
            return []
        ret = []

        left = 0
        right = len(p)
        p_sorted = sorted(p)

        while right <= len(s):
            cur_str = s[left:right]
            cur_str_sorted = sorted(cur_str)
            if p_sorted == cur_str_sorted:
                ret.append(left)
            left += 1
            right += 1
        return ret


def main():
    s = "cbaebabacd"
    p = "abc"
    ret = Solution().findAnagrams(s, p)
    print(ret)

    s = "abab"
    p = "ab"
    ret = Solution().findAnagrams(s, p)
    print(ret)

    s = "baaaa"
    p = "aa"
    ret = Solution().findAnagrams(s, p)
    print(ret)

    s = "abaacbabc"
    p = "abc"
    ret = Solution().findAnagrams(s, p)
    print(ret)

    s = ""
    p = ""
    ret = Solution().findAnagrams(s, p)
    print(ret)


if __name__ == "__main__":
    main()
